(8, 1, '2016-07-10 22:15:16', '2016-07-10 22:15:16', 'Inspired by the enormous growth of the new racing format in the western hemisphere we decided to form a governing body in the eastern part of the globe. This will professionalize Enduro racing by the formulation of policies, guidelines, and rules in line with international standards.\r\n\r\nThe ENDURO NETWORK ASIA is a collaboration of seasoned MTB riders and proficient race organizers in Asia with these goals:\r\n<ol>\r\n 	<li>1. Standardize the rules and regulations of the enduro racing format in Asia.</li>\r\n 	<li>2. Breed more Asian talents for international competitions.</li>\r\n 	<li>3. Contribute to a countrys economy through sports tourism.</li>\r\n</ol>\r\nGearing towards the goals, we have organized the ASIAN ENDURO SERIES\r\n<p style="text-align: justify;">The series will be officially launched in 2016 with Nepal as the jump-starter race.</p>\r\n<p style="text-align: justify;">While the AES is the ultimate event, the standard rules will also apply to other Enduro tournaments organized by affiliated hosts or members.</p>', 'About us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2016-07-12 18:02:09', '2016-07-12 18:02:09', '', 0, 'http://localhost:8888/enduro/?page_id=8', 0, 'page', '', 0),
