(238, 1, '2016-07-12 12:22:48', '2016-07-12 12:22:48', 'From all of us at the EWS we wish all of the riders in Nepal a great race. Its amazing to see and hear of enduro racers taking part in events around the world and we are stoked to hear of you all racing in the Asia Enduro Series on the 7th April. Remember to keep it fun out there, look after each other and enjoy the trails!', 'Chris Ball', '', 'publish', 'open', 'open', '', 'chris-ball', '', '', '2016-07-12 13:21:08', '2016-07-12 13:21:08', '', 0, 'http://localhost:8888/enduro/?p=238', 0, 'post', '', 0),
