(245, 1, '2016-07-12 12:26:53', '2016-07-12 12:26:53', '<h4></h4>\r\nThe former national downhill champion and Co-Director of Gnarly has directed several bike races in the past. He is also a trainer for young cyclists (Gnarly Squadron rides) in addition to being one of the most sought-after guides. With fluid knowledge of trails and sports management, Shyam brings vital talent to this event as the Race Director of NEPAL ENDURO in the AES 2016.', 'Shyam Limbu', '', 'publish', 'open', 'open', '', 'shyam-limbu', '', '', '2016-07-12 13:17:11', '2016-07-12 13:17:11', '', 0, 'http://localhost:8888/enduro/?p=245', 0, 'post', '', 0),
(246, 1, '2016-07-12 12:26:53', '2016-07-12 12:26:53', '<h4></h4>\r\nThe former national downhill champion and Co-Director of Gnarly has directed several bike races in the past. He is also a trainer for young cyclists (Gnarly Squadron rides) in addition to being one of the most sought-after guides. With fluid knowledge of trails and sports management, Shyam brings vital talent to this event as the Race Director of NEPAL ENDURO in the AES 2016.', 'Shyam Limbu', '', 'inherit', 'closed', 'closed', '', '245-revision-v1', '', '', '2016-07-12 12:26:53', '2016-07-12 12:26:53', '', 245, 'http://localhost:8888/enduro/2016/07/12/245-revision-v1/', 0, 'revision', '', 0),
(247, 1, '2016-07-12 12:27:46', '2016-07-12 12:27:46', 'A Dentist by profession , Dr. Rodel is the President of The Enduro Network Philippines. He is an aggressive all-mountain rider and a strong climber, but it is his character and leadership skills that placed him to the challenging position, carrying on the vision of Philippine Enduro.', 'Rodel Porto', '', 'publish', 'open', 'open', '', 'rodel-porto', '', '', '2016-07-12 13:16:09', '2016-07-12 13:16:09', '', 0, 'http://localhost:8888/enduro/?p=247', 0, 'post', '', 0),
(248, 1, '2016-07-12 12:27:46', '2016-07-12 12:27:46', 'A Dentist by profession , Dr. Rodel is the President of The Enduro Network Philippines. He is an aggressive all-mountain rider and a strong climber, but it is his character and leadership skills that placed him to the challenging position, carrying on the vision of Philippine Enduro.', 'Rodel Porto', '', 'inherit', 'closed', 'closed', '', '247-revision-v1', '', '', '2016-07-12 12:27:46', '2016-07-12 12:27:46', '', 247, 'http://localhost:8888/enduro/2016/07/12/247-revision-v1/', 0, 'revision', '', 0),
(249, 1, '2016-07-12 12:28:42', '2016-07-12 12:28:42', 'The cycling communities in Indonesia call him <em>Rifu</em>. He was a journalist for Ridebike Indonesia until the magazine demise in 2014. He is a versatile rider with some podium appearances in races across various genre including downhill, cross country, even fixed-gear alley cat and trackstand contest! With his experience and love for riding bikes, his involvement in The Enduro Network Asia will help push the Enduro racing format in Indonesia into the right direction.', 'Arief Nugroho', '', 'publish', 'open', 'open', '', 'arief-nugroho', '', '', '2016-07-12 13:17:54', '2016-07-12 13:17:54', '', 0, 'http://localhost:8888/enduro/?p=249', 0, 'post', '', 0),
(250, 1, '2016-07-12 12:28:42', '2016-07-12 12:28:42', 'The cycling communities in Indonesia call him <em>Rifu</em>. He was a journalist for Ridebike Indonesia until the magazine demise in 2014. He is a versatile rider with some podium appearances in races across various genre including downhill, cross country, even fixed-gear alley cat and trackstand contest! With his experience and love for riding bikes, his involvement in The Enduro Network Asia will help push the Enduro racing format in Indonesia into the right direction.', 'Arief Nugroho', '', 'inherit', 'closed', 'closed', '', '249-revision-v1', '', '', '2016-07-12 12:28:42', '2016-07-12 12:28:42', '', 249, 'http://localhost:8888/enduro/2016/07/12/249-revision-v1/', 0, 'revision', '', 0),
(251, 1, '2016-07-12 12:29:23', '2016-07-12 12:29:23', '<h4></h4>\r\nGempur has been to mountain biking since early nineties and worked part time as a mechanic in a local bike shop in upstate New York during summer high school. He raced in regional cross country and four cross competitions. Initiating the Yeti Tribe Indonesia in 2011, Gempur managed grassroots racing for youths at the local pump track.  Also a co-founder of Street Dirt Project, he has organized DJ and four cross events as well for Polygon.', 'Gempur Suharto', '', 'publish', 'open', 'open', '', 'gempur-suharto', '', '', '2016-07-12 13:24:17', '2016-07-12 13:24:17', '', 0, 'http://localhost:8888/enduro/?p=251', 0, 'post', '', 0),
(252, 1, '2016-07-12 12:29:23', '2016-07-12 12:29:23', '<h4></h4>\r\nGempur has been to mountain biking since early nineties and worked part time as a mechanic in a local bike shop in upstate New York during summer high school. He raced in regional cross country and four cross competitions. Initiating the Yeti Tribe Indonesia in 2011, Gempur managed grassroots racing for youths at the local pump track.  Also a co-founder of Street Dirt Project, he has organized DJ and four cross events as well for Polygon.', 'Gempur Suharto', '', 'inherit', 'closed', 'closed', '', '251-revision-v1', '', '', '2016-07-12 12:29:23', '2016-07-12 12:29:23', '', 251, 'http://localhost:8888/enduro/2016/07/12/251-revision-v1/', 0, 'revision', '', 0),
(253, 1, '2016-07-12 12:29:53', '2016-07-12 12:29:53', '<div class="et_pb_module et_pb_team_member et_pb_team_member_4 et_pb_bg_layout_light clearfix">\r\n<div class="et_pb_team_member_description">\r\n\r\nWith specialization in brand promotion and media relations, Anuj brings technical and PR skills as the Co-Director of Gnarly. Further, keeping abreast with latest marketing trends and strategies, Anuj intends to mobilize his programming, photography and writing skills to make the NEPAL ENDURO an unprecedented success.\r\n\r\n</div>\r\n</div>\r\n<div class="et_pb_module et_pb_team_member et_pb_team_member_5 et_pb_bg_layout_light clearfix"></div>', 'Anuj Adhikary', '', 'publish', 'open', 'open', '', 'anuj-adhikary', '', '', '2016-07-12 13:24:01', '2016-07-12 13:24:01', '', 0, 'http://localhost:8888/enduro/?p=253', 0, 'post', '', 0),
(254, 1, '2016-07-12 12:29:53', '2016-07-12 12:29:53', '<div class="et_pb_module et_pb_team_member  et_pb_team_member_4 et_pb_bg_layout_light clearfix">\r\n<div class="et_pb_team_member_description">\r\n\r\nWith specialization in brand promotion and media relations, Anuj brings technical and PR skills as the Co-Director of Gnarly. Further, keeping abreast with latest marketing trends and strategies, Anuj intends to mobilize his programming, photography and writing skills to make the NEPAL ENDURO an unprecedented success.\r\n\r\n</div>\r\n</div>\r\n<div class="et_pb_module et_pb_team_member  et_pb_team_member_5 et_pb_bg_layout_light clearfix"></div>', 'Anuj Adhikary', '', 'inherit', 'closed', 'closed', '', '253-revision-v1', '', '', '2016-07-12 12:29:53', '2016-07-12 12:29:53', '', 253, 'http://localhost:8888/enduro/2016/07/12/253-revision-v1/', 0, 'revision', '', 0),
(255, 1, '2016-07-12 12:30:24', '2016-07-12 12:30:24', 'A former Enduro/DH national rider in France before leaving 3 years ago to Vietnam to focus on new challenges. He spent 8 years riding multiple MTB event format in Europe and was among the first riders in the early stages of Enduro. His riding experiences include the Mass Start Megavalanche, Enduro Series, Team Enduro Racing, and Rally Enduro. After 2 years off, the passion caught Florent back and now use his wide experience to develop mountain bike activity in Vietnam through training camps, trails building and fun events. Now he is up for the big project: organizing the Asian Enduro Series-Vietnam.', 'Florent Poilane', '', 'publish', 'open', 'open', '', 'florent-poilane', '', '', '2016-07-12 19:24:39', '2016-07-12 19:24:39', '', 0, 'http://localhost:8888/enduro/?p=255', 0, 'post', '', 0),
(256, 1, '2016-07-12 12:30:24', '2016-07-12 12:30:24', 'A former Enduro/DH national rider in France before leaving 3 years ago to Vietnam to focus on new challenges. He spent 8 years riding multiple MTB event format in Europe and was among the first riders in the early stages of Enduro.  His riding experiences include the Mass Start Megavalanche, Enduro Series, Team Enduro Racing, and Rally Enduro. After 2 years off, the passion caught Florent back and now use his wide experience to develop mountain bike activity in Vietnam through training camps, trails building and fun events. Now he is up for the big project : organizing the Asian Enduro Series-Vietnam.', 'Florent POILANE', '', 'inherit', 'closed', 'closed', '', '255-revision-v1', '', '', '2016-07-12 12:30:24', '2016-07-12 12:30:24', '', 255, 'http://localhost:8888/enduro/2016/07/12/255-revision-v1/', 0, 'revision', '', 0),
(257, 1, '2016-07-12 12:31:01', '2016-07-12 12:31:01', 'The pioneer of Enduro Pilipinas, he has organized 23 Enduro races across the country since 2012. A visionary and a people person, Sly has successfully mentored race organizers in all corners of the Philippines. He is a member of EMBA- Enduro Mountain Bike Association . Sly is also a professional K9 Behaviorist and he rides with his trail dog Ruxy', 'Sly Lumbao', '', 'publish', 'open', 'open', '', 'sly-lumbao', '', '', '2016-07-12 13:10:27', '2016-07-12 13:10:27', '', 0, 'http://localhost:8888/enduro/?p=257', 0, 'post', '', 0),
(258, 1, '2016-07-12 12:31:01', '2016-07-12 12:31:01', 'The pioneer of Enduro Pilipinas, he has organized 23 Enduro races across the country since 2012. A visionary and a people person, Sly has successfully mentored race organizers in all corners of the Philippines. He is a member of EMBA- Enduro Mountain Bike Association . Sly is also a professional K9 Behaviorist and he rides with his trail dog Ruxy', 'Sly Lumbao', '', 'inherit', 'closed', 'closed', '', '257-revision-v1', '', '', '2016-07-12 12:31:01', '2016-07-12 12:31:01', '', 257, 'http://localhost:8888/enduro/2016/07/12/257-revision-v1/', 0, 'revision', '', 0),
