(293, 1, '2016-07-12 14:58:57', '2016-07-12 14:58:57', 'Inspired by the enormous growth of the new racing format in the western hemisphere we decided to form a governing body in the eastern part of the globe. This will professionalize Enduro racing by the formulation of policies , guidelines ,and rules in line with international standards.\r\n\r\nThe ENDURO NETWORK ASIA is a collaboration of seasoned MTB riders and proficient race organizers in Asia with these goals:\r\n\r\n1. Standardize the rules and regulations of the enduro racing format in Asia.\r\n2. Breed more Asian talents for international competitions.\r\n3. Contribute to a countrys economy through sports tourism.\r\nGearing towards the goals , we have organized the ASIAN ENDURO SERIES\r\n\r\nThe series will be officially launched in 2016 with Nepal as the jump-starter race.\r\n\r\nWhile the AES is the ultimate event, the standard rules will also apply to other Enduro tournaments organized by affiliated hosts or members.', 'About us', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2016-07-12 14:58:57', '2016-07-12 14:58:57', '', 8, 'http://localhost:8888/enduro/2016/07/12/8-revision-v1/', 0, 'revision', '', 0),
