(310, 1, '2016-07-12 19:23:26', '2016-07-12 19:23:26', 'A former Enduro/DH national rider in France before leaving 3 years ago to Vietnam to focus on new challenges. He spent 8 years riding multiple MTB event format in Europe and was among the first riders in the early stages of Enduro.  His riding experiences include the Mass Start Megavalanche, Enduro Series, Team Enduro Racing, and Rally Enduro. After 2 years off, the passion caught Florent back and now use his wide experience to develop mountain bike activity in Vietnam through training camps, trails building and fun events. Now he is up for the big project : organizing the Asian Enduro Series-Vietnam.', 'Florent Poilane', '', 'inherit', 'closed', 'closed', '', '255-revision-v1', '', '', '2016-07-12 19:23:26', '2016-07-12 19:23:26', '', 255, 'http://localhost:8888/enduro/2016/07/12/255-revision-v1/', 0, 'revision', '', 0),
(312, 1, '2016-07-12 19:24:39', '2016-07-12 19:24:39', 'A former Enduro/DH national rider in France before leaving 3 years ago to Vietnam to focus on new challenges. He spent 8 years riding multiple MTB event format in Europe and was among the first riders in the early stages of Enduro. His riding experiences include the Mass Start Megavalanche, Enduro Series, Team Enduro Racing, and Rally Enduro. After 2 years off, the passion caught Florent back and now use his wide experience to develop mountain bike activity in Vietnam through training camps, trails building and fun events. Now he is up for the big project: organizing the Asian Enduro Series-Vietnam.', 'Florent Poilane', '', 'inherit', 'closed', 'closed', '', '255-revision-v1', '', '', '2016-07-12 19:24:39', '2016-07-12 19:24:39', '', 255, 'http://localhost:8888/enduro/2016/07/12/255-revision-v1/', 0, 'revision', '', 0),
